import React from 'react';
import {Menu} from 'semantic-ui-react';

export default () => {
  return (
    <Menu tabular>
      <Menu.Item
        name='bio'
        active={activeItem === 'bio'}
      />
      <Menu.Item
        name='photos'
        active={activeItem === 'bio'}
      />
    </Menu>
  );
}
